import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function TableService() {
    return (
        <Card style={{ width: '22rem' }}>
          <Card.Body style={{backgroundColor:'lightcoral'}}>
            <Card.Title style={{textAlign:'center'}}><h1>Table Service</h1></Card.Title>
            <Card.Text style={{marginLeft:20}}>
                <Card.Img variant="top" src="https://www.greycoatlumleys.co.uk/rails/active_storage/blobs/eyJfcmFpbHMiOnsibWVzc2FnZSI6IkJBaHBBd3RkSVE9PSIsImV4cCI6bnVsbCwicHVyIjoiYmxvYl9pZCJ9fQ==--5bc62c277f63fc8cc8ccb013562607d80ca84585/The%20different%20types%20of%20table%20service%20you%20need%20to%20know%20about.jpg" width={300} height={300}/>
                <h2> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Table service is a common type of restaurant service all over the world. 
                In this type of service, customers are seated at a table and served by a waiter or waitress.</h2>
            </Card.Text>
            {/* <Button variant="primary">Go somewhere</Button> */}
          </Card.Body>
        </Card>
      );
}
